module.exports = {
    getreservationcard:function(... value){
       return  {
            "type": "AdaptiveCard",
            "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
            "version": "1.3",
            "body": [
                {
                    "type": "TextBlock",
                    "text": "________________________________________________",
                    "wrap": true
                },
                {
                    "type": "ColumnSet",
                    "columns": [
                        {
                            "type": "Column",
                            "width": "stretch",
                            "items": [
                                {
                                    "type": "Image",
                                    "url": "data:image/png;base64,"
                                }
                            ]
                        },
                        {
                            "type": "Column",
                            "width": "stretch"
                        }
                    ]
                },
                {
                    "type": "ColumnSet",
                    "columns": [
                        {
                            "type": "Column",
                            "width": "stretch",
                            "items": [
                                {
                                    "type": "TextBlock",
                                    "wrap": true,
                                    "text": "______",
                                    "weight": "Lighter"
                                },
                                {
                                    "type": "TextBlock",
                                    "wrap": true,
                                    "text": `ID : ${value[6]}`,
                                    "color": "Accent",
                                    "fontType": "Monospace",
                                    "size": "Medium"
                                },
                                {
                                    "type": "ColumnSet",
                                    "columns": [
                                        {
                                            "type": "Column",
                                            "width": "stretch",
                                            "items": [
                                                {
                                                    "type": "TextBlock",
                                                    "wrap": true,
                                                    "text": `passanger : ${value[5]}`,
                                                    "style": "columnHeader"
                                                }
                                            ]
                                        },
                                        {
                                            "type": "Column",
                                            "width": "stretch",
                                            "items": [
                                                {
                                                    "type": "TextBlock",
                                                    "wrap": true,
                                                    "text": `${value[0]}`,
                                                    "style": "columnHeader",
                                                    "horizontalAlignment": "Right"
                                                }
                                            ]
                                        }
                                    ],
                                    "style": "good"
                                },
                                {
                                    "type": "ColumnSet",
                                    "columns": [
                                        {
                                            "type": "Column",
                                            "width": "stretch",
                                            "items": [
                                                {
                                                    "type": "TextBlock",
                                                    "wrap": true,
                                                    "text": `${value[1]}`,
                                                    "style": "columnHeader"
                                                }
                                            ]
                                        },
                                        {
                                            "type": "Column",
                                            "width": "stretch",
                                            "items": [
                                                {
                                                    "type": "TextBlock",
                                                    "wrap": true,
                                                    "text": `${value[2]}`,
                                                    "style": "columnHeader",
                                                    "horizontalAlignment": "Right"
                                                }
                                            ]
                                        }
                                    ],
                                    "style": "good"
                                }
                            ]
                        }
                    ]
                },
                {
                    "type": "ColumnSet",
                    "spacing": "None",
                    "columns": [
                        {
                            "type": "Column",
                            "width": 1,
                            "items": [
                                {
                                    "type": "TextBlock",
                                    "spacing": "None",
                                    "wrap": true,
                                    "text": `${value[3]}`,
                                    "size": "ExtraLarge",
                                    "color": "Accent"
                                },
                                {
                                    "type": "TextBlock",
                                    "spacing": "None",
                                    "wrap": true,
                                    "text": "PUNJAB",
                                    "color": "Accent"
                                }
                            ]
                        },
                        {
                            "type": "Column",
                            "width": "auto",
                            "items": [
                                {
                                    "type": "Image",
                                    "size": "Small",
                                    "spacing": "None",
                                    "width": "90px",
                                    "height": "70px",
                                    "url": "data:image/png;base64,"
                                }
                            ]
                        },
                        {
                            "type": "Column",
                            "width": 1,
                            "items": [
                                {
                                    "type": "TextBlock",
                                    "horizontalAlignment": "Right",
                                    "spacing": "None",
                                    "wrap": true,
                                    "text": `${value[4]}`,
                                    "size": "ExtraLarge",
                                    "color": "Accent"
                                },
                                {
                                    "type": "TextBlock",
                                    "horizontalAlignment": "Right",
                                    "spacing": "None",
                                    "wrap": true,
                                    "text": "PUNJAB",
                                    "color": "Accent"
                                }
                            ]
                        }
                    ]
                }
            ]
        }
    }
    }
